description:
In this sequel to the Evil Dead films, a discount-store employee (&quot;Name's Ash. Housewares.&quot;) is time-warped to a medieval castle beset by monstrous forces. Initially mistaken for an enemy, he is soon revealed as the prophecised savior who can quest for the Necronomicon, a book which can dispel the evil. Unfortunately, he screws up the magic words while collecting the tome, and releases an army of skeletons, led by his own Deadite counterpart. What follows is a thrilling, yet tongue-in-cheek battle between Ash's 20th Century tactics and the minions of darkness.
